import React from 'react';
import logo from './logo.svg';
import './App.css';

const Todo =({todo}) => <li>{todo}</li>;

const Todos = () => <ul>
  <Todo todo="ecrire" />
</ul>

function App() {
  return (
    <div className="App">
      <Todos/>
    </div>
  );
}

export default App;
